import React from 'react';
import Todos from './components/Todos';

import './App.css';

class App extends Component{
  state = {
    todos:[
      {
        id:1,
        title: "Take out the trash",
        completed:false
      },
      {
        id:2,
        title: "Go to dinner with friend",
        completed:false
      },
      {
        id:3,
        title: "Meet with client",
        completed:false
      }
    ]
  }

  render(){
    return ( 
      <div className="App">

        <h1>Hello</h1>
        <Todos/>
      </div>
    );
  }
}

export default App;
